export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{"7M4NcTbSkB":{data:{id:2626,attributes:{imdbId:"tt0048728",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BODM2ODgyOGYtYzYwMC00ZTEwLTg2MmItZDI2OTdhMTdiMGFiL2ltYWdlXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.4\u002F10"},{Source:"Rotten Tomatoes",Value:"94%"},{Source:"Metacritic",Value:"82\u002F100"}],item_lang:{data:{id:3289,attributes:{title:c,plot:"American expatriate John Robie, living in high style on the Riviera, is a retired cat burglar. He must find out who a copycat is to keep a new wave of jewel thefts from being pinned on him. High on the list of prime victims is Jessie Stevens, in Europe to help daughter Frances find a suitable husband.",slug:"to-catch-a-thief"}}},books:{data:[{id:12569,attributes:{title:c,description:e,thumbnail:f,authors:[b],firstBook:true,published:g,publisher:h,subtitle:a}},{id:12570,attributes:{title:c,description:e,thumbnail:f,authors:[b],firstBook:d,published:g,publisher:h,subtitle:a}},{id:12571,attributes:{title:"Plunder of the Sun",description:"A globe-spanning treasure-hunt adventure filled with “action, suspense, and excitement . . . pure escape” (San Francisco Chronicle). Al Colby should never have said yes. When asked to smuggle a package from Chile to Peru, he should have run in the other direction. But he needed money, and he wanted the adventure. Now a man is dead, and two beautiful women seem out to seduce Al or kill him—or maybe both. A handful of gunmen, however, definitely aren’t planning on seducing him first. And it all has something to do with that package, an ancient manuscript that reads like a treasure map . . . From the bestselling author of the classic To Catch a Thief—the basis for the Hitchcock film—this is an entertaining, fast-paced story of international intrigue and danger.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=c1V4BgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:i,publisher:j,subtitle:a}},{id:12572,attributes:{title:c,description:"A woman falls in love with a reformed jewel thief, but suspects he's active again when a series of jewel heists occur.",thumbnail:a,authors:[b,"Alfred Hitchcock"],firstBook:d,published:"2007-01-01",publisher:a,subtitle:a}},{id:12573,attributes:{title:"Death and Taxes",description:"A CPA in 1940s San Francisco searches for his partner’s killer in this witty and “hard-hitting” mystery by the author of the classic To Catch a Thief (Time Magazine). The first in the series of noir mysteries starring hard-drinking accountant Whit Whitney, Death and Taxes follows the calculating amateur detective as he looks into the murder of George MacLeod—a top tax consultant who was a close colleague of Whitney’s, at least until his body was stuffed into a bank vault. A fast-paced, sharp-witted tale involving everything from pretty blondes to bootleggers to tangles with the Treasury Department, Death and Taxes “winds up at a lightning pace . . . Fast and easy to read” (New York Herald Tribune).",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=cFR4BgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:i,publisher:j,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940907768}}("","David Dodge","To Catch a Thief",null,"The classic mystery later turned into an Academy Award-winning film by Alfred Hitchcock, this startling whodunit still resonates today with wit and danger. “Le Chat” is a legend. He is a mystery. He is a jewel thief, famous and elusive for being able to swipe anything and get away clean. He is John Robie, retired and living a quiet life, tending his rose garden in the South of France. But his retirement plans are thrown for a loop when a series of robberies too closely resemble the work of “Le Chat,” and the police start digging into Robie’s past. To keep himself free, and with the help of an equally mysterious young woman, John Robie will have to catch the true thief, before the police catch him.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3FN4BgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2015-02-01","Diversion Books","2015-02-03","Diversion Publishing Corp."))